var stocks_arr = null
function get_arr(){
  if(stocks_arr == null){
    stocks_arr = []
    var s = stocks.split('\n')
    for(var i = 0; i < s.length; i++){
      stocks_arr.push(s[i].split(','))
    }
  }
}
  

function search(key){
  get_arr()
  var arr = []
  var num = 0
  for (var i = 0; i < stocks_arr.length; i++){
    for (var j = 0; j < stocks_arr[0].length; j++){
      if (stocks_arr[i][j].search(key) != -1){
        arr.push(stocks_arr[i])
        num += 1
        break
      }
    }
    if(num >= 50){
      break;
    }
  }  
  return arr

}

function get_some_stocks(i) {
  return stocks.split('\n').slice(i, i + 20)
}

function get_name(id){
  var s = stocks.split('\n')
  var arr = []
  for(var i = 0; i < id.length; i++){
    for(var j = 0; j < s.length; j++){
      if(s[j].split(',')[0] == id[i]){
        arr.push(s[j])
        break;
      }
    }
  }
  return arr
}
